import React from "react";
import carMarket from "../carMarket";
import "./App.css";
import Nav from "./nav/Nav.js";

function App() {
  const getAllButtonsLable = (data) => {
    let res = Object.keys(data);
    return res.map((title) => {
      console.log(title);
      let btntitle = title[0].toUpperCase() + title.slice(1);
      return btntitle.replace("_", " ");
    });
  };

  return (
    <>
      <div className="nav">
        <h2 id="logo">Car market</h2>
        <Nav title={getAllButtonsLable(carMarket)} />
      </div>
      <div className="content-main-box">
        {/* <h1>add a title dinamically</h1> */}
        title
      </div>
    </>
  );
}

export default App;
